import React from 'react'
import {
    Switch,
    Route,
    useParams
} from "react-router-dom";

export default function SwitchComp() {
    return (
        <Switch>
            <Route exact path="/">
                <Home />
            </Route>
            <Route path="/contentdatas">
                <ContentDatas />
            </Route>
            <Route path="/comments">
                <Comments />
            </Route>
            <Route path="/contacts">
                <Contacts />
            </Route>
            <Route path="/useradmin">
                <UserAdmin />
            </Route>
            <Route path="/errors/:id?">
                <Errors />
            </Route>
        </Switch>
    )
}

function Home() {
    return <h2>Home</h2>;
}
function ContentDatas() {
    return <h2>ContentData</h2>;
}

function Comments() {
    return <h2>Comment</h2>;
}

function Contacts() {
    return <h2>Contact</h2>;
}
function Errors() {
    let { id } = useParams();
    return <h2>ErrorCatch {id}</h2>;
}
function UserAdmin() {
    return <h2>User</h2>;
}
